import { SEARCH_DATA, STORE_DATA } from "../ActionTypes/actiontype";
const init = {
  data: [],
  search: "",
};
const reducer = (state = init, {type,payload}) => {
  switch (action.type) {
    case STORE_DATA:
      return { ...state, data: action.payload };
    case SEARCH_DATA:
      return { ...state, search: action.payload };
    default:
      return state;
  }
};
export { reducer };
